<!DOCTYPE html>
<html>
  <head><base href="https://keyforu.net/">
    <meta charset="utf-8" />
    <title>KeysForU</title>
    <script type="text/javascript">
      var segmentCount = 0;
      var l = window.location;
      l.replace(
        l.protocol +
          '//' +
          l.hostname +
          (l.port ? ':' + l.port : '') +
          l.pathname
            .split('/')
            .slice(0, 1 + segmentCount)
            .join('/') +
          '/?p=/' +
          l.pathname
            .slice(1)
            .split('/')
            .slice(segmentCount)
            .join('/')
            .replace(/&/g, '~and~') +
          (l.search ? '&q=' + l.search.slice(1).replace(/&/g, '~and~') : '') +
          l.hash,
      );
    </script>
  <link href="style.8b35e92090657b50e17f.css" rel="stylesheet"></head>

  <body><script type="text/javascript" src="react.ec853ee4b163028cffd3.js"></script><script type="text/javascript" src="app.bundle.8b35e92090657b50e17f.js"></script></body>
</html>
